void bufferAppend(wstring &buf, string const &str)
{
  symbuf.append(str);

  for(size_t i = 0, limit = symbuf.size(); i < limit;)
  {
    wchar_t symbol;
    int gap = mbtowc(&symbol, symbuf.c_str() + i, MB_CUR_MAX);
    if(gap == -1)
    {
      if(i + MB_CUR_MAX < limit)
      {
        buf += L'?';
        gap = 1;
      }
      else
      { 
        symbuf = symbuf.substr(i);
        return;
      }
    }
    else 
    { 
      buf += symbol;
    }

    i += gap;
  }

  symbuf = "";
  return;
}


